 Here is a simple JavaScript code that sorts the keys of a dictionary (object) alphabetically and outputs their corresponding values:

```javascript
var dict = {
    apple: 1,
    banana: 2,
    cherry: 3,
    date: 4,
    fig: 5
};

// Sort keys in dictionary alphabetically
function sortObjectKeys(obj) {
    var keys = Object.keys(obj).sort();

    // Output the values corresponding to the sorted keys
    for (var i in keys) {
        console.log(obj[keys[i]]);
    }
}

// Call the function with the dictionary as argument
sortObjectKeys(dict);
```

This code defines a `sortObjectKeys` function that takes an object as input and sorts its keys alphabetically before outputting their corresponding values. The `Object.keys` method is used to get an array of the object's own enumerable property names, which is then sorted using the built-in sort method. Finally, a loop iterates through the sorted keys and outputs the corresponding values.
